INSERT INTO `rb_lk_pojok_literasi` (`id_pojok_literasi`, `id_identitas_sekolah`, `judul`, `deskripsi`, `dokumen`) VALUES
(6, 4, 'PHP', '<p>\r\n\r\n</p><p><b>PHP</b>&nbsp;adalah <em>bahasa pemrograman script server-side yang didesain untuk pengembangan web. Selain itu, PHP juga bisa digunakan sebagai bahasa pemrograman umum</em>&nbsp;(<a target=\"_blank\" rel=\"nofollow\" href=\"http://en.wikipedia.org/wiki/PHP\">wikipedia</a>). PHP di kembangkan pada tahun 1995 oleh <b>Rasmus Lerdorf</b><b></b>, dan sekarang dikelola oleh <b>The PHP Group</b>. Situs resmi PHP beralamat di <a target=\"_blank\" rel=\"nofollow\" href=\"http://www.php.net/\">http://www.php.net</a>.</p><p>PHP disebut bahasa pemrograman <strong>server side</strong>&nbsp;karena PHP diproses pada komputer server. Hal ini berbeda dibandingkan dengan bahasa pemrograman client-side seperti JavaScript yang diproses pada web browser (client).</p>\r\n\r\n<br><p></p>', 'pojok_PT_CHEVRON_INDONESIA.pdf'),
(7, 4, 'Javascript', '<p>\r\n\r\nBegin learning here by typing in your first name surrounded by quotation marks, and ending with a semicolon. For example, you could type the name <code>\"Jamie\";</code>&nbsp; and then hit enter.\r\n\r\n<br></p>', 'pojok_New_Doc_2019-10-01_12_11_46.pdf');
